import React from "react";
import AddCategory from "./AddCategory";

const CreateClothesModal = ({ onClose }) => {
  return (
    <div
      className="fixed left-0 top-0 w-full h-full flex items-end justify-center bg-stone-500/50"
      onClick={onClose}
    >
      <div
        className="rounded-md bg-white p-4 w-80 mb-[85px]"
        onClick={(e) => e.stopPropagation()}
      >
        <h2 className="text-lg font-bold mb-2">Create Clothes</h2>
        <AddCategory />
      </div>
    </div>
  );
};

export default CreateClothesModal;
